import React from 'react'
import axios from 'axios'


class UserDisplay extends React.Component{

    //get data from student table
    componentDidMount(){
        axios.get("http://localhost:3030/students_url").then((res)=>{
            console.log(res)
        })
    }

    render(){
        return(
           <section>
               <div class="container">
                   <div class="col-md-4">
                       <h5>Name: Ram</h5>
                       <p>Age: 25</p>
                    </div>
                   </div>
                   <div class="col-md-4">
                       <h5>Name: Ram</h5>
                       <p>Age: 25</p>

                   </div>
                   <div class="col-md-4">
                       <h5>Name: Ram</h5>
                       <p>Age: 25</p>

                   </div>
               
           </section>
        )
    }
}


export default UserDisplay
